import React, {Component} from 'react';
import './StylingCss.css'

const heading = {
    textDecoration: "underline",
    color: 'red'
}

function StylingCss (props) {
    return (
        <div>
            <h1 style={heading}>inline</h1>
        </div>
    );
};

export default StylingCss;
